import React from 'react';
import Button from '@material-ui/core/Button';
import AddIcon from '@material-ui/icons/Add';
import AddBoxIcon from '@material-ui/icons/AddBox';

const Form = () => {

    const addItem = () => {
        console.log("Clicked");
    }

    return(
        <>
            <div className="container">
                <div className="row d-flex justify-content-center">
                    <div className="card col-12 col-md-4 mt-2">
                        <form className="card-body">
                        <div className="mb-3">                
                            <input type="text" className="form-control" id="title" placeholder="Title" aria-describedby="emailHelp" />
                        </div>
                        <div className="">
                            <textarea className="form-control" placeholder="Content" id="floatingTextarea"></textarea>
                        </div>
                        <Button type="button" onClick={addItem} className="btn btn_Add btn-sm btn-default float-right mt-2"><AddIcon /></Button>
                        </form>
                    </div>
                </div>
            </div>
        </>
    )
}
export default Form;
